package com.imantou.cache.constant;

public interface CharSequence {

    /**
     * 字符串常量：{@code "null"} <br>
     * 注意：{@code "null" != null}
     */
    String NULL = "null";

    /**
     * 字符串常量：空字符串 {@code ""}
     */
    String EMPTY = "";

    /**
     * 字符串常量：空格符 {@code " "}
     */
    String SPACE = " ";
}
